import './MyFeedWrite';
import '../css/myFeedWrite.scss';

function MyFeedWrite() {
  return (
    <div className="MyFeedWrite">
      <h1>MyFeed</h1>

      <div className="form-wrapper">
        <input className="title-input" type="text" placeholder="일상" />{' '}
        <button className="submit-button">입력</button>
      </div>
    </div>
  );
}

export default MyFeedWrite;
